/* This example requires Tailwind CSS v2.0+ */
import React from "react";


const navigation = [
  { name: 'Bio', href: '#', current: true },
  { name: 'Whats I was Made', href: '#', current: false },
]

export default function Example() {
  return (
    <div className='items-center flex bg-rose-600 w-full px-11'>
        <div>
            <a className='text-2xl uppercase font-semibold text-white'>logo</a>
        </div>
        <div className='flex flex-col text-rose-100 '>
            <a className="px-3 py-4 hover:text-white hover:underline underline-offset-8">Bio</a>
            <a className="px-3 py-4 hover:text-white hover:underline underline-offset-8">What I Made</a>
        </div>
    </div>
  );
}
